/* eslint-disable react/jsx-pascal-case */
import {useState} from 'react'
import CarData from '../data/CarData'

function 자동차뷰() {
    let [카데이타, 카변동데이타] = useState (CarData)
    return(
        <카정보컴포넌트 carlist={카데이타[0]}/>


    )
}

export default 자동차뷰


function 카정보컴포넌트(props) {
    return(
        <div>
            <h2>{props.carlist[0].model}</h2>
            <p>{props.carlist[0].number}</p>
            <p>{props.carlist[0].location}</p>
        </div>
    )

}
